import TakeAction from "./pages/TakeAction";
import ContactUs from "./pages/ContactUs"; 
import { Parallax } from 'react-parallax'; // Import Parallax component



export default function App() {


  return (
    <div>
      {/* HEADER */}
      <Header />
      <div id="home">
        <Home />  {/* Home Section */}
      </div>

      {/* COMPANY LOGO */}
      <div className="logo">
          <img src="/assets/logo.jpg" alt="GalaxyEDGE Safety Inc." className="logo-img" />
      </div>

      <div id="about-us">
        <About />  {/* About Us Section */}
      </div>

      <div id="learn_more">
        <TakeAction />  
      </div>





    </div>
  );
}
